function (inputs, outputs, advanced) {
    const { state } = advanced;
    const { output1, output2, output3 } = outputs;
    const { value } = inputs;
    const currentOutput = state.get("currentOutput") || 0;

    if (currentOutput === 0) {
      output1.next(value);
      state.set("currentOutput", 1);
    } else if (currentOutput === 1) {
      output2.next(value);
      state.set("currentOutput", 2);
    } else if (currentOutput === 2) {
      output3.next(value);
      state.set("currentOutput", 0);
    }
  }
